/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<table border="0" cellspacing="0" cellpadding="0" @keydown="${context._onkeydown}"><thead><tr id="${ifDefined(context._id)}-columnHeader" class="ui5-table-header-row" tabindex="0" style="height: 48px" @click="${context._onColumnHeaderClick}">			${ repeat(context.visibleColumns, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</tr></thead><tbody>		${ repeat(context.rows, (item, index) => item._id || index, (item, index) => block2(item, index, context)) }${ !context.rows.length ? block3(context) : undefined }</tbody></table>`; };
const block1 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>			`; };
const block2 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>		`; };
const block3 = (context) => { return html`${ context.showNoData ? block4(context) : undefined }`; };
const block4 = (context) => { return html`<tr class="ui5-table-no-data-row-root"><td colspan="${ifDefined(context.visibleColumnsCount)}"><div class="ui5-table-no-data-row"><span>${ifDefined(context.noDataText)}</span></div></td></tr>			`; };

export default block0;
